import React, { useState, useEffect, useCallback } from 'react';
import { Search, Settings } from 'lucide-react';
import ReactMarkdown from 'react-markdown';
import remarkGfm from 'remark-gfm';

function App() {
  const [description, setDescription] = useState('');
  const [analysisResult, setAnalysisResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const API_URL = "http://localhost:8000";

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!description) return;
    setIsLoading(true);
    setAnalysisResult(null);

    try {
      const [searchRes, analysisRes] = await Promise.all([
        fetch(`${API_URL}/search-incidents/`, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ query: description }),
        }),
        fetch(`${API_URL}/analyze-incident-details/`, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ query: description }),
        }),
      ]);

      if (!searchRes.ok || !analysisRes.ok) throw new Error('API Error');

      const searchData = await searchRes.json();
      const analysisData = await analysisRes.json();

      setAnalysisResult({ 
        type: 'success', 
        data: { search: searchData, analysis: analysisData.analysis } 
      });
    } catch (error) {
      setAnalysisResult({ type: 'error', message: error.toString() });
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="bg-slate-50 min-h-screen font-sans p-8">
      <div className="container mx-auto">
        <header className="text-center mb-8">
          <h1 className="text-5xl font-bold text-indigo-700">AIOps Co-pilot</h1>
        </header>
        <main className="grid grid-cols-1 lg:grid-cols-2 gap-8">
          <div className="bg-white p-6 rounded-lg shadow-md">
            <form onSubmit={handleSubmit} className="space-y-4">
              <div>
                <label htmlFor="description" className="block text-sm font-medium text-slate-700 mb-1">Incident Description / Logs</label>
                <textarea id="description" value={description} onChange={e => setDescription(e.target.value)} rows="8" className="w-full p-2 border rounded-md" />
              </div>
              <button type="submit" disabled={isLoading} className="w-full py-3 px-4 bg-indigo-600 text-white font-semibold rounded-lg shadow-md hover:bg-indigo-700 disabled:bg-indigo-400">
                {isLoading ? <Settings className="animate-spin mx-auto" /> : 'Analyze Incident'}
              </button>
            </form>
          </div>
          <div className="bg-white p-6 rounded-lg shadow-md">
            <h2 className="text-2xl font-semibold text-slate-800 mb-4">Analysis Results</h2>
            {isLoading && <p>Analyzing...</p>}
            {analysisResult && analysisResult.type === 'success' && (
              <div className="space-y-6">
                {analysisResult.data.analysis && (
                  <div className="p-4 bg-slate-100 rounded-lg">
                    <h3 className="font-bold">AI Analysis</h3>
                    <p><strong>Category:</strong> {analysisResult.data.analysis.category}</p>
                    <p><strong>Summary:</strong> {analysisResult.data.analysis.summary}</p>
                    <p><strong>Probable Cause:</strong> {analysisResult.data.analysis.probable_cause}</p>
                  </div>
                )}
                <div>
                  <h3 className="font-bold border-t pt-4">Similar Historical Incidents</h3>
                  <ul>
                    {analysisResult.data.search.results.map((item, index) => (
                      <li key={index} className="py-2">
                        <p>{item.document.title} (Score: {item.similarity_score.toFixed(4)})</p>
                      </li>
                    ))}
                  </ul>
                </div>
              </div>
            )}
            {analysisResult && analysisResult.type === 'error' && <p className="text-red-500">{analysisResult.message}</p>}
          </div>
        </main>
      </div>
    </div>
  );
}

export default App;
